<span class="line"><span style="color:#FFCB6B;">--user-agent=x</span><span style="color:#EEFFFF;"> </span><span style="color:#C3E88D;">,</span><span style="color:#EEFFFF;"> </span><span style="color:#C3E88D;">-U</span><span style="color:#EEFFFF;"> </span><span style="color:#C3E88D;">x</span><span style="color:#EEFFFF;">        </span><span style="color:#545454;font-style:italic;"># 设置用户代理（指定 HTTP user agent）</span></span>
